//SBGOLOBT  JOB (ACCT#),S-GOLOB,
// NOTIFY=&SYSUID,
// CLASS=B,MSGCLASS=X
//* ------------------------------------------------------------ *//
//*                                                              *//
//*      SAMPLE TSO RECEIVE JOB TO CREATE LOAD LIBRARIES         *//
//*                                                              *//
//*          (SUBSTITUTE YOUR OWN DSN AND VOLUME)                *//
//*                                                              *//
//* ------------------------------------------------------------ *//
//TSOBATCH EXEC PGM=IKJEFT01
//SYSTSPRT DD SYSOUT=*
//SYSTSIN DD *
  RECEIVE INDS('SBGOLOB.CBT479.FILE614(SHOZ716L)')
  DSN('SBGOLOB.TEST.SHOW716.LOADLIB') VOL(WORK05) UNIT(SYSALLDA)
/*

@FILE614.text:
//***FILE 614 is from Sam Golob and contains load module libraries  *   FILE 614
//*           for various versions of the SHOWMVS and SHOWZOS       *   FILE 614
//*           programs from File 492.  Roland Schiradin requested   *   FILE 614
//*           that I not include load module libraries in File      *   FILE 614
//*           492 itself, because of the various versions of z/OS   *   FILE 614
//*           products such as ISPF and LE and TCP/IP which may     *   FILE 614
//*           be included in the final load module and which may    *   FILE 614
//*           cause some problem in some systems, if they are the   *   FILE 614
//*           wrong version for that system.  So it is best for     *   FILE 614
//*           each installation to assemble and linkedit SHOWMVS    *   FILE 614
//*           or SHOWZOS for itself.                                *   FILE 614
//*                                                                 *   FILE 614
//*           However, it is difficult for some shops to assemble   *   FILE 614
//*           SHOWMVS and SHOWZOS, because they don't have the      *   FILE 614
//*           proper version of the High Level Assembler (ASMA90)   *   FILE 614
//*           or they are missing some of the other requirements    *   FILE 614
//*           for properly creating a SHOWMVS or SHOWZOS load       *   FILE 614
//*           module.  Therefore, I have created this file so       *   FILE 614
//*           that such shops can have a quick install of SHOWMVS   *   FILE 614
//*           or SHOWZOS, to suit (at least) most of their needs.   *   FILE 614
//*                                                                 *   FILE 614
//*       email:  sbgolob@cbttape.org                               *   FILE 614
//*                                                                 *   FILE 614
//*       To create a load library from one of these members,       *   FILE 614
//*       use the RECEIVE command under TSO:                        *   FILE 614
//*                                                                 *   FILE 614
//*       RECEIVE INDS(hlq.FILE614.pds(memname))                    *   FILE 614
//*                                                                 *   FILE 614
//*       and answer the prompts for DSN( ), VOL( ), UNIT( ) etc.   *   FILE 614
//*       or just press ENTER.                                      *   FILE 614
//*                                                                 *   FILE 614
//*  Note:  SHOWzOS 7.17 and 7.18 assemble differently on z/OS 1.8  *   FILE 614
//*         systems and on z/OS 1.9 systems.  The z/OS 1.9 assembly *   FILE 614
//*         load module will work on 1.8, but the z/OS 1.8 load     *   FILE 614
//*         module will get an abend when run on z/OS 1.9 or 1.10.  *   FILE 614
//*         Similar results occur for SHOWzOS 7.19, and I suppose,  *   FILE 614
//*         for 7.20.                                               *   FILE 614
//*                                                                 *   FILE 614
//*         Therefore if you have multiple systems, it is           *   FILE 614
//*         recommended that you assemble SHOWzOS on z/OS 1.9 or    *   FILE 614
//*         higher.  Members marked SHO9xxxx were assembled at      *   FILE 614
//*         the z/OS 1.9 level.  Members marked SHOAxxxx were       *   FILE 614
//*         assembled on a z/OS 1.10 system.  Members marked        *   FILE 614
//*         SHOBxxxx were assembled on a z/OS 1.11 system.          *   FILE 614
//*         Similarly, SHOCxxxx on 1.12, and SHODxxxx on 1.13,      *   FILE 614
//*         and SHOExxxx on 2.1, and SHOGxxxx on 2.2.               *   FILE 614
//*                                                                 *   FILE 614
//*         Reassembled 2013/12/12 for z/OS 1.13, PUT LEVEL 1311.   *   FILE 614
//*         Members:  ASMLD721, SHOD721M.                           *   FILE 614
//*                                                                 *   FILE 614
//*         Reassembled 2014/05/15 for z/OS 2.1, PUT LEVEL 1403.    *   FILE 614
//*         Members:  ASMLE722, SHOE722L.                           *   FILE 614
//*                                                                 *   FILE 614
//*         Reassembled 2015/01/20 for z/OS 2.1, PUT LEVEL 1412.    *   FILE 614
//*         PTF Levels:  UA90741, UA90742, UA90740 and z/OS 2.2.    *   FILE 614
//*         Members:  ASMLF722, SHOF722L.  Old versions of          *   FILE 614
//*         SHOWzOS will not work if ULUT is Type 3 (now 64-bit)    *   FILE 614
//*         after PUT 1412 maintenance is applied.                  *   FILE 614
//*                                                                 *   FILE 614
//*         Reassembled 2015/06/09 for z/OS 2.1 PUT LEVEL 1503.     *   FILE 614
//*         This is SHOWzOS 7.23.  ASMLF723, SHOF723L.              *   FILE 614
//*                                                                 *   FILE 614
//*         There is a newer SHOWzOS 7.23 version, as below.        *   FILE 614
//*                                                                 *   FILE 614
//*         Reassembled the newer SHOWzOS 7.23 version using        *   FILE 614
//*         z/OS 2.1 at PUT Level 1505.  Dated 2015/08/02.          *   FILE 614
//*         This is SHOWzOS 7.23.  ASMLF723, SHOF723M.              *   FILE 614
//*                                                                 *   FILE 614
//*         The "final" version of SHOWzOS 7.23 was assembled       *   FILE 614
//*         on z/OS 2.2 at PUT Level 1611.  Members SHOG723M        *   FILE 614
//*         and ASMLH723.  Solved LOGGER problem.                   *   FILE 614
//*                                                                 *   FILE 614
//*         The initial version of SHOWzOS 7.25 was assembled       *   FILE 614
//*         on z/OS 2.4 at PUT Level 2004.  Members SHOH725L        *   FILE 614
//*         and ASMLH725.                                           *   FILE 614
//*                                                                 *   FILE 614
//*         SHOWzOS 8.01 was assembled on z/OS 2.4 at PUT level     *   FILE 614
//*         2008.  Members SHOH801L and ASMLH801.                   *   FILE 614
//*         (Some machines cannot run SHOWzOS 8.01.  It is          *   FILE 614
//*         suggested to run SHOWzOS 7.25 in these cases.  It       *   FILE 614
//*         should run fine.)                                       *   FILE 614
//*                                                                 *   FILE 614

ASMLA719.text:
//SBGOLOBO JOB (ACCT#),SHOWMVS,
// NOTIFY=&SYSUID,
// CLASS=A,
// MSGCLASS=X,
// REGION=0M
//ASMH EXEC PGM=ASMA90,
// PARM=(GOFF,NODECK,LIST(133),NOESD,NORLD,OBJ,SIZE(MAX-1M,ABOVE))
//* Use SHOWZOS if running on z/Architectur and z/OS R3 and above
//*PARM=(OBJECT,NODECK,BATCH,NOESD,NORLD,NOXREF,SIZE(MAX-1M,ABOVE))
//* Use SHOWMVS if running on NON z/Architectur OR z/OS R2 and below
//*PARM=(OBJECT,NODECK,BATCH,NOESD,NORLD,NOXREF,SIZE(MAX-1M,ABOVE))
//* Use SHOW630 if ShowMvs is not supported
//SYSIN    DD DISP=SHR,DSN=IBMUSER.B.ASM(SHOWZOS)
//SYSLIB   DD DISP=SHR,DSN=SYS1.MACLIB      z/OS r1.10
//         DD DISP=SHR,DSN=SYS1.MODGEN
//* OS/390 (R6) and below
//* If member EZAZTSEB exsits please move TCPIP.SEZACMAC at the end
//         DD DISP=SHR,DSN=TCPIP.SEZACMAC         optional
//         DD DISP=SHR,DSN=CEE.SCEEMAC            optional
//* z/OS R4 and above (EZBNMIFR API)
//         DD DISP=SHR,DSN=TCPIP.SEZANMAC         required
//         DD DISP=SHR,DSN=SYS1.SHASMAC           required
//* to create the SHOWMVS.MACLIB library, execute FILE492.PDS(SHOWMACS)
//         DD DISP=SHR,DSN=IBMUSER.SHO9719.MACLIB ShowMVS macros
//         DD DISP=SHR,DSN=IBMUSER.CBT478.FILE492 STRING macro
//SYSPRINT DD SYSOUT=*
//SYSUT1   DD UNIT=SYSDA,SPACE=(CYL,15)
//SYSLIN   DD UNIT=SYSDA,SPACE=(TRK,20),DISP=(,PASS),DCB=BLKSIZE=3200
//ISPLOAD  DD DISP=SHR,DSN=ISP.SISPLOAD(ISPLINK)  customize
//TMPLINK  DD UNIT=SYSDA,SPACE=(CYL,(1,,1)),DISP=(,PASS),DSN=&&TMPLINK
//SYSLMOD  DD DISP=SHR,DSN=IBMUSER.SHOA719.LOAD
//*-------------------------------------------------------------------*
//*                                                                   *
//*       First test step (TSO Batch)                                 *
//*                                                                   *
//*-------------------------------------------------------------------*
//         IF ASMH.RC < 8 THEN
//TMPLINK  EXEC PGM=IEWL,PARM=RENT
//SYSLIB   DD DISP=SHR,DSN=CEE.SCEELKED           optional
//SYSLIN   DD DSN=*.ASMH.SYSLIN,DISP=(OLD,PASS)
//SYSUT1   DD UNIT=SYSDA,SPACE=(CYL,1)
//SYSLMOD  DD DSN=&&TMPLINK(SHOWMVS),DISP=(OLD,PASS)
//SYSPRINT DD SYSOUT=*
//         ENDIF
//         IF   (ASMH.RC < 8 & TMPLINK.RC < 8) THEN
//*-------------------------------------------------------------------*
//*                                                                   *
//*       This is the link-edit step for SHOWMVS                      *
//*                                                                   *
//*-------------------------------------------------------------------*
//LKED     EXEC PGM=IEWL,PARM='LIST,MAP,RENT,AC=1'
//ISPLOAD  DD DISP=SHR,DSN=*.ASMH.ISPLOAD
//SYSLIB   DD DISP=SHR,DSN=CEE.SCEELKED           optional
//SYSUT1   DD UNIT=SYSDA,SPACE=(CYL,1)
//SYSLIN   DD DSN=*.ASMH.SYSLIN,DISP=(OLD,PASS)
//         DD *
 ALIAS SHOWZOS
 INCLUDE ISPLOAD(ISPLINK)
 NAME ISFINIT(R)
//SYSPRINT DD SYSOUT=*
//SYSLMOD  DD DISP=SHR,DSN=*.ASMH.SYSLMOD
//         ENDIF
//* Invoke SHOWMVS without Authorization
//         IF   (ASMH.RC < 8 & TMPLINK.RC < 8) THEN
//KEY8     EXEC PGM=IKJEFT01,TIME=(,30)
//STEPLIB  DD DSN=&&TMPLINK,DISP=(OLD,PASS)
//         DD DISP=SHR,DSN=CEE.SCEERUN            required
//         DD DISP=SHR,DSN=DB2.SDSNEXIT           DSNHMCID for V8
//         DD DISP=SHR,DSN=DB2.SDSNLOAD           optional
//SYSTSIN  DD *
SHOWMVS /* SHORT_PUTLINE */
SHOWMVS PUTLINE
//*SHOWMVS SMF=232
//*SHOWMVS TCP=148.251.068.082:08000
//SYSTSPRT DD SYSOUT=*
//ABNLTERM DD SYSOUT=*
//SYSUDUMP DD SYSOUT=*,OUTLIM=20000
//         ENDIF
//* Invoke SHOWMVS with Authorization under TSO (KEY4)
//         IF   (ASMH.RC < 8 & TMPLINK.RC < 8) THEN
//KEY4     EXEC PGM=IKJEFT01,TIME=(,59)
//STEPLIB  DD DISP=SHR,DSN=*.ASMH.SYSLMOD
//         DD DISP=SHR,DSN=CEE.SCEERUN            required or Linklist
//         DD DISP=SHR,DSN=DB2.SDSNEXIT           DSNHMCID for V8
//         DD DISP=SHR,DSN=DB2.SDSNLOAD           optional
//SYSTSIN  DD *
CALL 'IBMUSER.LOAD(SHOWMVS)' 'PUTLINE'
//SYSTSPRT DD SYSOUT=*
//ABNLTERM DD SYSOUT=*
//SYSUDUMP DD SYSOUT=*
//         ENDIF
//* Invoke SHOWMVS with Authorization (KEY0)
//         IF   (ASMH.RC < 8 & TMPLINK.RC < 8) THEN
//KEY0     EXEC PGM=SHOWMVS
//STEPLIB  DD DISP=SHR,DSN=*.ASMH.SYSLMOD
//         DD DISP=SHR,DSN=CEE.SCEERUN            required or Linklist
//         DD DISP=SHR,DSN=DB2.SDSNEXIT           DSNHMCID for V8
//         DD DISP=SHR,DSN=DB2.SDSNLOAD           optional
//SHOWMVS  DD SYSOUT=*
//ABNLTERM DD SYSOUT=*
//SYSUDUMP DD SYSOUT=*
//         ENDIF
//
//* Inactive |||
//* Invoke SHOWMVS with Authorization writing output to SMF Type 232
//* PARM SMF works only using source SHOWzOS
//KEY0SMF EXEC PGM=SHOWMVS,PARM='SMF=232'   Write data to SMF type 232
//STEPLIB  DD DISP=SHR,DSN=*.ASMH.SYSLMOD
//         DD DISP=SHR,DSN=CEE.SCEERUN            required or Linklist
//         DD DISP=SHR,DSN=DB2.SDSNEXIT           DSNHMCID for V8
//         DD DISP=SHR,DSN=DB2.SDSNLOAD           optional
//SHOWMVS  DD SYSOUT=*
//ABNLTERM DD SYSOUT=*
//SYSUDUMP DD SYSOUT=*
//
//* Inactive |||
//* Cleanup step
//IDCAMS   EXEC  PGM=IDCAMS
//SYSPRINT DD SYSOUT=*
 DELETE IBMUSER.SHOWMVS.PRINT
 DELETE IBMUSER.X2P.SHOWMVS
//* This step create the SHOWMVS output as PDF file using
//* a nice utility from Martin Truebner
//KEY0PDF1 EXEC PGM=SHOWMVS
//STEPLIB  DD DISP=SHR,DSN=*.ASMH.SYLMOD
//         DD DISP=SHR,DSN=CEE.SCEERUN            required or Linklist
//         DD DISP=SHR,DSN=DB2.SDSNEXIT           DSNHMCID for V8
//         DD DISP=SHR,DSN=DB2.SDSNLOAD           optional
//SHOWMVS  DD  DSN=IBMUSER.SHOWMVS.PRINT,
//             UNIT=SYSALLDA,SPACE=(TRK,(10,10),RLSE),
//             LRECL=123,RECFM=FBA,
//             DISP=(NEW,CATLG,DELETE)
//ABNLTERM DD SYSOUT=*
//SYSUDUMP DD SYSOUT=*
//*
//* Issue TSO RECEIVE INDA(x.x.x(XP2XMIT)) to create
//* IBMUSER.X2P2C.LOADLIB |||
//KEY0PDF2 EXEC PGM=X2PMP
//STEPLIB  DD DISP=SHR,DSN=IBMUSER.X2P2C.LOADLIB
//FORMLIB  DD DISP=SHR,DSN=IBMUSER.X2P2C.LOADLIB
//INFILE   DD  DISP=SHR,DSN=IBMUSER.SHOWMVS.PRINT
//PDFOUT   DD  DSN=IBMUSER.X2P.SHOWMVS,
//             UNIT=SYSALLDA,SPACE=(TRK,(10,10),RLSE),
//             LRECL=256,RECFM=FB,  SUPERFLOUSH - JUST FOR THE RECORD
//             BLKSIZE=2560,
//             DISP=(NEW,CATLG,DELETE)
//SYSPRINT DD  SYSOUT=*
//LOGFILE  DD  SYSOUT=*
//INPARM   DD  *
INDRV=3 OUTDRV=3 X2POPT=CMQ DEFFORM='SHOWFRM /B' BKMEXIT=SHOWBKM

